script: |
  super -f text -I q6847.spq | sort > q6847.out

inputs:
  - name: q6847.spq
    data: |
      SELECT DISTINCT - + 21 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - - col0 + - 9 * + - col2 NOT IN ( + + 25 + + col2, + 17 * + 27 + col2 );
  - name: tab2

outputs:
  - name: q6847.out
    data: |
